import React from "react";
import styled from "styled-components";

const HeroImg = styled.img`
  width: auto;
  height: 90vh;
  margin-top: 10vh;
  z-index: 6;
  
  &:hover {
  background-color: red;
  }
`;

export default HeroImg;
